import React, { useEffect, useState } from 'react';
import './App.css';

interface MilkInformation {
  count: number;
  name: string;
}

function App() {
  const [MilkData, setMilkData] = useState<MilkInformation[]>([]);

  useEffect(() => {
    const getData = async () => {
      const response = await fetch("https://localhost:7023/api/milk");
      const weatherResults = await response.json();
      setWeatherData(weatherResults);
    }
    getData();
  }, [])

  return (
    <div>
      <h1>{MilkData.length}</h1>
      {weatherData.map(w =>
        <ul>
          <li>{w.summary}</li>
          <li>{w.temperatureC}</li>
        </ul>
      )}
    </div>
  );
}

export default App;
